    parameter w = 6;
    parameter Wc = 32;
    
    output reg [w-1:0]min1;
    output reg [w-1:0]min2;
    output reg [$clog2(Wc)-1:0]index;
    input [Wc*w - 1: 0]inp;
    
    wire [w-1:0]inp_sep[Wc-1:0];
    genvar i;
    generate
        for(i = 0; i < Wc; i=i+1)begin : loop_name
            assign inp_sep[i] = inp[ (i+1)*w-1 : i*w];
        end
    endgenerate
    
    //Array
    wire [Wc-1:0]comp_array[Wc-1:0];
    
